  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS dataset contains point features
  that represent Leaking Underground Storage Tanks in US EPA Region 9 Indian Country.
  This dataset contains facility name and locational information, status of LUST case,
  operating status of facility, inspection dates, and links to No Further Action letters
  for closed LUST cases. This database contains 1230 features, with 289 features having
  a LUST status of \"open\", \"closed with no residual contamination\", or \"closed
  with residual contamination\".\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
